import React from "react";
import "./App.css";

export const Item = React.memo(({ items, ONCliCK }) => {
  // console.log("n = ", TODOitem);

  return (
    <React.Fragment>
      {items.map((item) => (
        <li key={item.id}>
          <span>{item.task}</span>
          <span>
            <i
              className="far fa-trash-alt delete"
              onClick={() => ONCliCK(item)}
            ></i>
          </span>
        </li>
      ))}
    </React.Fragment>
  );
});
